import React from 'react';
import './skills.css';
import UIDesign from '../../asset/experience.png';
import WebDesign from '../../asset/web design.png';
import AppDesign from '../../asset/design.png';

const Skills = () => {
  return (
    <section id='skills'>
        <span className='skillTitle'>What I do</span>
        <span className='skillDesc'>I am a skilled and passionate 2D Designer with experience in creating 2D visually appealing and user-friendly </span>
    </section>
  )
}

export default Skills
